import React from 'react';
import { FiDroplet, FiLayout, FiTool } from 'react-icons/fi';
import PropTypes from 'prop-types';

const iconMap = {
  FiLayout,
  FiTool,
  FiDroplet
};

const ServiceCard = ({ service, variant = 'default' }) => {
  const Icon = iconMap[service.icon];

  return (
    <div className={`service-card service-${variant}`}>
      {variant !== 'minimal' && (
        <div 
          className={`icon-wrapper ${service.waterEffect ? 'water-effect' : ''}`}
          style={{ background: service.gradient }}
        >
          <Icon className="service-icon" />
        </div>
      )}
      <div className="service-content">
        <h3>{service.title}</h3>
        <p>{service.description}</p>
      </div>
    </div>
  );
};

ServiceCard.propTypes = {
  service: PropTypes.shape({
    id: PropTypes.number.isRequired,
    icon: PropTypes.string.isRequired,
    title: PropTypes.string.isRequired,
    description: PropTypes.string.isRequired,
    gradient: PropTypes.string,
    waterEffect: PropTypes.bool
  }).isRequired,
  variant: PropTypes.oneOf(['default', 'minimal', 'featured'])
};

export default ServiceCard;
